import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import Container from '@mui/material/Container';
import Button from '@mui/material/Button';
import MenuItem from '@mui/material/MenuItem';

const pages = ['harshitabhatt58@gmail.com', '262-271-4822', 'LinkedIn Account', 'Upwork Profile'];
const settings = ['Profile', 'Account', 'Dashboard', 'Logout'];

function Footer() {
  const [anchorElNav, setAnchorElNav] = React.useState(null);
  const [fontSize, setFontSize] = React.useState(16); // Initial font size

  const handleOpenNavMenu = (event) => {
    setAnchorElNav(event.currentTarget);
  };

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };

  function getPage(page) {
    if (page.includes("262")) {
      return '';
    }
    if (page.includes("@")) {
      return '';
    }
    if (page.includes("work")) {
      return 'https://www.upwork.com/freelancers/~018a84f99caa186205';
    }
    if (page.includes("ink")) {
      return 'https://www.linkedin.com/in/harshita-bhatt/';
    }
  }

  React.useEffect(() => {
    // Function to dynamically adjust font size based on available space
    const handleResize = () => {
      const containerWidth = document.getElementById('footer-container').offsetWidth;
      const menuItemCount = pages.length;
      const maxMenuItemWidth = containerWidth / menuItemCount;

      // Calculate the maximum font size based on the available space
      const maxFontSize = Math.floor(maxMenuItemWidth / 10); // Adjust as needed

      // Set the font size to the smaller of the two (initial or maximum)
      setFontSize(Math.min(fontSize, maxFontSize));
    };

    // Initial font size adjustment
    handleResize();

    // Listen for window resize events to update font size dynamically
    window.addEventListener('resize', handleResize);

    return () => {
      // Remove the event listener on component unmount
      window.removeEventListener('resize', handleResize);
    };
  }, [fontSize]);

  return (
    <AppBar position="relative" sx={{ backgroundColor: '#CCA06F', px: 0 }}>
      <Container maxWidth="xl" id="contact">
        <Toolbar disableGutters>
          <Typography
            variant="h6"
            noWrap
            component="a"
            href="/"
            sx={{
              mr: 0,
              display: { xs: 'none', md: 'flex' },
              fontFamily: 'montserrat',
              fontWeight: 700,
              letterSpacing: '.3rem',
              color: 'inherit',
              textDecoration: 'none',
              flexGrow: 1,
            }}
          >
            Consulting with Harshita
          </Typography>

          <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' } }}>
            <IconButton
              size="large"
              aria-label="menu"
              aria-controls="menu-appbar"
              aria-haspopup="true"
              onClick={handleOpenNavMenu}
            ></IconButton>
            <Menu
              id="menu-appbar"
              anchorEl={anchorElNav}
              anchorOrigin={{
                vertical: 'bottom',
                horizontal: 'left',
              }}
              keepMounted
              transformOrigin={{
                vertical: 'top',
                horizontal: 'left',
              }}
              open={Boolean(anchorElNav)}
              onClose={handleCloseNavMenu}
              sx={{
                display: { xs: 'block', md: 'none' },
              }}
            >
              {pages.map((page) => (
                <MenuItem key={page} onClick={handleCloseNavMenu}>
                  <Typography textAlign="center">{page}</Typography>
                </MenuItem>
              ))}
            </Menu>
          </Box>

          <Typography
            variant="h5"
            noWrap
            component="a"
            href="/"
            sx={{
              mr: 2,
              display: { xs: 'flex', md: 'none' },
              flexGrow: 1,
              fontFamily: 'montserrat',
              fontWeight: 700,
              letterSpacing: '.3rem',
              color: 'inherit',
              textDecoration: 'none',
            }}
          >
            LOGO
          </Typography>

          <Box
            id="footer-container" // Add an ID for calculating available space
            sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' } }}
          >
            {pages.map((page) => (
              <a key={page} href={getPage(page)}>
                <Button
                  onClick={handleCloseNavMenu}
                  sx={{
                    my: 2,
                    color: 'white',
                    display: 'block',
                    fontFamily: 'montserrat',
                    mx: 1,
                    fontSize: `${fontSize}px`, // Set the dynamic font size
                  }}
                >
                  {page}
                </Button>
              </a>
            ))}
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
}

export default Footer;
